import React from 'react';
import { ArrowLeft, BarChart2, DollarSign, Users, Clock } from 'lucide-react';

const StatCard = ({ icon, label, value, change }) => (
  <div style={{
    backgroundColor: 'white',
    borderRadius: '12px',
    boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)',
    padding: '16px',
    display: 'flex',
    flexDirection: 'column',
    height: '100%',
  }}>
    <div style={{ display: 'flex', alignItems: 'center', marginBottom: '12px' }}>
      {icon}
      <span style={{ marginLeft: '8px', fontSize: '16px', fontWeight: '500', color: '#4B5563' }}>{label}</span>
    </div>
    <div style={{ fontSize: '24px', fontWeight: 'bold', color: '#1F2937', marginBottom: '8px' }}>{value}</div>
    <div style={{ 
      fontSize: '14px', 
      color: change >= 0 ? '#10B981' : '#EF4444',
      display: 'flex',
      alignItems: 'center'
    }}>
      {change >= 0 ? '↑' : '↓'} {Math.abs(change)}% rispetto al mese precedente
    </div>
  </div>
);

const LastMonthView = ({ setView }) => {
  // Dati di esempio, da sostituire con dati reali
  const stats = [
    { icon: <BarChart2 size={24} />, label: 'Fatturato', value: '€45,231', change: 5.2 },
    { icon: <DollarSign size={24} />, label: 'Profitto', value: '€12,543', change: -2.1 },
    { icon: <Users size={24} />, label: 'Nuovi Clienti', value: '23', change: 15.0 },
    { icon: <Clock size={24} />, label: 'Ore Lavorate', value: '168', change: 3.7 },
  ];

  return (
    <div style={{
      backgroundColor: '#F0F9FF',
      minHeight: '100vh',
      padding: '16px',
      fontFamily: "'Helvetica Neue', Arial, sans-serif",
    }}>
      <div style={{ maxWidth: '1024px', margin: '0 auto' }}>
        <div style={{ display: 'flex', alignItems: 'center', marginBottom: '24px' }}>
          <button 
            onClick={() => setView('main')} 
            style={{
              background: 'none',
              border: 'none',
              cursor: 'pointer',
              display: 'flex',
              alignItems: 'center',
              fontSize: '16px',
              color: '#4B5563',
            }}
          >
            <ArrowLeft size={24} style={{ marginRight: '8px' }} />
            Torna alla Dashboard
          </button>
        </div>

        <h1 style={{
          fontSize: '28px',
          fontWeight: 'bold',
          textAlign: 'center',
          marginBottom: '24px',
          color: '#2D3748',
        }}>
          Statistiche Ultimo Mese
        </h1>

        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(2, 1fr)', gap: '16px' }}>
          {stats.map((stat, index) => (
            <StatCard key={index} {...stat} />
          ))}
        </div>

        {/* Placeholder per grafici o tabelle aggiuntive */}
        <div style={{ marginTop: '32px', display: 'grid', gridTemplateColumns: 'repeat(2, 1fr)', gap: '16px' }}>
          <div style={{ 
            backgroundColor: 'white', 
            borderRadius: '12px', 
            boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)', 
            padding: '16px',
            height: '300px',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            fontSize: '18px',
            color: '#4B5563'
          }}>
            Grafico Fatturato Mensile
          </div>
          <div style={{ 
            backgroundColor: 'white', 
            borderRadius: '12px', 
            boxShadow: '0 4px 6px rgba(0, 0, 0, 0.1)', 
            padding: '16px',
            height: '300px',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',
            fontSize: '18px',
            color: '#4B5563'
          }}>
            Tabella Clienti Principali
          </div>
        </div>
      </div>
    </div>
  );
};

export default MainView;
